<style>html, body {
    margin: 0;
    padding: 0;
    height: 100%;
    overflow: hidden; /* Prevent scrolling */
}

.main-content-wrapper {
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-template-rows: 1fr 1fr;
    gap: 10px;
    width: 95vw; /* Use full viewport width */
    height: 95vh; /* Use full viewport height */
    box-sizing: border-box;
}

/* styles.css updates */
/* Improved 3-plot layout */
.main-content-wrapper.three-plots {
    grid-template-columns: repeat(3, 1fr);
    grid-template-rows: auto 1fr;
}

.main-content-wrapper.three-plots .main-video-container {
    grid-column: 1 / -1;
    grid-row: 1;
    height: 50vh;
}

.main-content-wrapper.three-plots .plot-div_1,
.main-content-wrapper.three-plots .plot-div_2,
.main-content-wrapper.three-plots .plot-div_3 {
    height: 40vh;
}

/* Better responsive handling */
@media (max-width: 1200px) {
    .main-content-wrapper {
        grid-template-columns: 1fr;
        grid-template-rows: auto;
    }

    .main-video-container,
    .plot-div_1,
    .plot-div_2,
    .plot-div_3 {
        grid-column: 1;
        grid-row: auto;
        height: auto;
    }
}

.main-video-container, .plot-div_1, .plot-div_2, .plot-div_3 {
    border: 1px solid #ddd;
    padding: 0; /* Remove padding to avoid extra space */
    box-sizing: border-box;
    display: flex;
    justify-content: center;
    align-items: center;
    overflow: hidden; /* Prevent scrolling */
}

.main-video-container {
    grid-area: 1 / 1 / 2 / 2; /* Top left */
}

.plot-div_1 {
    grid-area: 1 / 2 / 2 / 3; /* Top right */
}

.plot-div_2 {
    grid-area: 2 / 1 / 3 / 2; /* Bottom left */
}

.plot-div_3 {
    grid-area: 2 / 2 / 3 / 3; /* Bottom right */
}

#main-video-container {
    width: 100%;
    height: 100%; /* Ensure the video container fills its grid cell */
    position: relative;
}

#main-video {
    width: 100%;
    height: 100%; /* Set video height to fill container */
    object-fit: contain; /* Adjust to fit within container while preserving aspect ratio */
}
/* Set the controls to the bottom center */
#controls {
    text-align: center; /* Align the controls to the left */
    margin-top: 20px;
    padding-left: 20px; /* Add some left padding for spacing */
    position: absolute;
    bottom: 10px;
    width: 100%;
}

.plot {
    width: 100%;
    height: 90%;
    object-fit: contain; /* Scale the plot to fit within the div */
    position: relative; /* Set the plot div as relative to position the dropdown */
    display: flex;
    flex-direction: column;
}

.figure-dropdown {
    position: relative; /* Changed from absolute */
    margin-top: 10px; /* Add margin for spacing */
    z-index: 10;
    width: auto;
    min-width: 120px;
    font-size: 0.8rem;
    background-color: rgba(255, 255, 255, 0.8);
    align-self: center; /* Center the dropdown */
}

.responsive-div {
    width: 100%;
    height: 100%;
    position: relative;
}</style></head>

  }
}

function pauseVideo(videoId) {
  if (videoPlayers[videoId]) {
    videoPlayers[videoId].pause();
  }
}

function goToFirstFrame(videoId) {
  if (videoPlayers[videoId]) {
    videoPlayers[videoId].currentTime = 0;
  }
}

function goToLastFrame(videoId) {
  if (videoPlayers[videoId]) {
    videoPlayers[videoId].currentTime = videoPlayers[videoId].duration;
  }
}
function changeSpeed(videoId){
    if (videoPlayers[videoId]) {
        videoPlayers[videoId].playbackRate = speed;
      }
}

function stopVideo(videoId) {
  if (videoPlayers[videoId]) {
    videoPlayers[videoId].pause();
    videoPlayers[videoId].currentTime = 0;
  }
}

playButton.addEventListener("click", function() {
  for (const videoId in videoPlayers) {
    playVideo(videoId);
  }
});

pauseButton.addEventListener("click", function() {
  for (const videoId in videoPlayers) {
    pauseVideo(videoId);
  }
});

firstFrameButton.addEventListener("click", function() {
  for (const videoId in videoPlayers) {
    goToFirstFrame(videoId);
    pauseVideo(videoId);
  }
});

lastFrameButton.addEventListener("click", function() {
  for (const videoId in videoPlayers) {
    goToLastFrame(videoId);
  }
});

increaseSpeedButton.addEventListener("click", function() {
  speed += 0.1
  for (const videoId in videoPlayers) {
    changeSpeed(videoId);
  }
});

decreaseSpeedButton.addEventListener("click", function() {
  speed -= 0.1
  for (const videoId in videoPlayers) {
    changeSpeed(videoId);
  }
});

const previousFrameButton = document.getElementById("previous-frame");
const nextFrameButton = document.getElementById("next-frame");

previousFrameButton.addEventListener("click", function() {
  for (const videoId in videoPlayers) {
    if (videoPlayers[videoId]) {
      videoPlayers[videoId].currentTime -= 1 / fps; // Assuming a frame rate of 30 fps
      pauseVideo(videoId); // Pause the video

    }
  }
});

nextFrameButton.addEventListener("click", function() {
  for (const videoId in videoPlayers) {
    if (videoPlayers[videoId]) {
      videoPlayers[videoId].currentTime += 1 / fps; // Assuming a frame rate of 30 fps
      pauseVideo(videoId); // Pause the video

    }
  }
});

// Right and left arrow keys to navigate through the video (next and previous frame)
document.addEventListener("keydown", function(event) {
  if (event.key === "ArrowRight") {
    for (const videoId in videoPlayers) {
      if (videoPlayers[videoId]) {
        videoPlayers[videoId].currentTime += 1 / fps; // Assuming a frame rate of 30 fps
        pauseVideo(videoId); // Pause the video
      }
    }
  } else if (event.key === "ArrowLeft") {
    for (const videoId in videoPlayers) {
      if (videoPlayers[videoId]) {
        videoPlayers[videoId].currentTime -= 1 / fps; // Assuming a frame rate of 30 fps
        pauseVideo(videoId); // Pause the video
      }
    }
  }
});

var current_pos = 0.0;
// Check which of the plotly divs is available
var plotlyDivs = ['plotly-div-1', 'plotly-div-2', 'plotly-div-3'];
// if its not available, take it out of the list
plotlyDivs = plotlyDivs.filter(function(div_id) {
    return document.getElementById(div_id) !== null;
});

function update_line(new_pos) {
    var linePos = parseFloat(new_pos);
    if (linePos < 0) {
        linePos = 0;
    }
    // Check for changes
    if (linePos === current_pos) {
        return;
    }
    // Update all plotly figures
    plotlyDivs.forEach(function(div_id) {
        Plotly.relayout(div_id, {
            'shapes[0].x0': linePos,
            'shapes[0].x1': linePos
        });
    });
    current_pos = linePos;
}


// The line of the plot should be synchronized with the video (assuming they both have the same number of frames)
mainVideo.addEventListener("timeupdate", function() {
  var new_pos = mainVideo.currentTime; //* fps;
  // for debugging purposes log the current time and new position
  console.log(mainVideo.currentTime, new_pos);
  update_line(new_pos);
});

// Initialize dropdowns if figures_dict has data
document.addEventListener("DOMContentLoaded", function() {
    // Initialize the figures from the dictionary if available
    if (Object.keys(figures_dict).length > 0) {
        // Initialize plot containers with empty plots if needed
        plotlyDivs.forEach(function(divId, index) {
            // Try to get the corresponding plot area dropdown
            const plotArea = index + 1;
            const dropdownSelector = `#dropdown-plot${plotArea}`;
            const dropdown = document.querySelector(dropdownSelector);

            if (dropdown) {
                // Set default value if we have it in default_figure_names
                const plotKey = `plot${plotArea}`;
                if (default_figure_names[plotKey]) {
                    dropdown.value = default_figure_names[plotKey];
                    // Only initialize empty plots
                    if (document.getElementById(divId).innerHTML === '') {
                        updatePlot(divId, default_figure_names[plotKey]);
                    }
                } else if (Object.keys(figures_dict).length > 0) {
                    // Fall back to first figure if no default is specified
                    const firstKey = Object.keys(figures_dict)[0];
                    dropdown.value = firstKey;
                    if (document.getElementById(divId).innerHTML === '') {
                        updatePlot(divId, firstKey);
                    }
                }

                // Add event listener to update the plot when dropdown changes
                dropdown.addEventListener('change', function() {
                    updatePlot(divId, this.value);
                });
            }
        });
    }
});

// Function to update a plot with selected figure from the dropdown
function updatePlot(divId, figureName) {
    if (figures_dict[figureName]) {
        // Parse the figure JSON
        const figureData = JSON.parse(figures_dict[figureName]);

        // Update the plot
        Plotly.react(divId, figureData.data, figureData.layout);

        // Update the time line
        update_line(current_pos);
    }
}

// Set up event listeners for all dropdowns
const dropdowns = document.querySelectorAll('.figure-dropdown');
dropdowns.forEach(function(dropdown) {
    dropdown.addEventListener('change', function() {
        // Get the plot container ID
        const plotContainer = this.closest('.plot');
        const plotDivId = plotContainer.querySelector('.responsive-div > div').id;

        // Update the plot with the selected figure
        updatePlot(plotDivId, this.value);
    });
});

// script.js updates
// Add click handler for plot seeking
function setupPlotClickHandler(divId) {
    const plotDiv = document.getElementById(divId);
    plotDiv.on('plotly_click', function(data) {
        const xValue = data.points[0].x;
        mainVideo.currentTime = xValue;
        mainVideo.pause();
        update_line(xValue);
    });
}

// Initialize click handlers for all plots
plotlyDivs.forEach(divId => setupPlotClickHandler(divId));


// Add bookmark functionality
let bookmarks = [];
function setBookmark() {
    const time = mainVideo.currentTime;
    bookmarks.push(time);
    const option = document.createElement('option');
    option.value = time;
    option.textContent = `Bookmark ${bookmarks.length} (${time.toFixed(2)}s)`;
    document.getElementById('bookmarks').appendChild(option);
}

function jumpToBookmark(time) {
    mainVideo.currentTime = parseFloat(time);
    mainVideo.pause();
    update_line(time);
}</script></body>
